(65, 'Dan ', 'Pafford', 'info@citiesawardcompany.com', '8885099915', 'I\'m writing to you today on behalf of the Irwin Award Program. We\'re the organization that puts on the annual \"Best of Irwin Award\", and I\'m pleased to inform you that your company has been selected as the winner in the category of Jewelry Designer.\n\nI know we\'ve tried to reach you a few times before, but we\'ve finally been able to get in touch with you through your website contact form. We wanted to make sure you were aware of this exciting news as soon as possible.\n\nWe\'ve included a link to our website below that more fully describes your recognition. We hope you\'ll look at it and share it with your staff.\n\nhttps://irwin.citiesawardcompany.com/SBRAFAP6\n\nCongratulations again on this well-deserved honor!\n\nSincerely,\n\nDan \n\nhttps://irwin.citiesawardcompany.com/sbrafap6_PERSONAL-CREATIONS-FOR-PRACTICAL-PE', '2023-09-28 02:57:21', '1'),
