INSERT INTO `email_templates` (`id`, `title`, `subject`, `message`, `status`, `ordering`, `image`, `created`, `modified`) VALUES
(3, 'Reset Your Password', 'Reset Your Password', '<p>[logo]</p>\r\n<p> </p>\r\n<p>Dear [full_name],</p>\r\n<p>Someone recently requested a password change for your [site_title] account. If this was you, you can set a new password here:</p>\r\n<p>Password reset link: [password_reset_link]</p>\r\n<p>If you don\'t want to change your password or didn\'t request this, just ignore and delete this message.</p>\r\n<p>To keep your account secure, please don\'t forward this email to anyone.</p>\r\n<p> </p>\r\n<p>Thanks & Regards,<br>[site_title]</p>\r\n<p> </p>\r\n<p> </p>', 'Active', 1, '', '2020-03-19 12:50:10', '2020-03-19 12:50:10'),
(4, 'Customer Invoice', 'Customer Invoice', '<p></p>\r\n<p></p>\r\n<p>Dear [full_name],</p>\r\n<p>Thank you for your order, your order invoice is attached.</p>\r\n<p> </p>\r\n<p>Regards,</p>\r\n<p>[site_title]</p>', 'Active', 2, 'logo.jpg', '2023-08-04 18:21:40', '2023-08-04 18:21:40'),
(5, 'Customer Password Reset', 'Customer Password Reset', '<table border=\"0\" width=\"100%\" cellpadding=\"50\" bgcolor=\"#f2f2f2\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table width=\"100%\" cellpadding=\"5\" align=\"center\" bgcolor=\"#E8E8E8\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table width=\"100%\" cellpadding=\"30\" align=\"center\" bgcolor=\"#ffffff\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>[logo]</p>\r\n<p> </p>\r\n<p>Dear [full_name],</p>\r\n<p>Someone recently requested a password change for your [site_title] account. If this was you, you can set a new password here:</p>\r\n<p>Password reset link: [password_reset_link]</p>\r\n<p>If you don\'t want to change your password or didn\'t request this, just ignore and delete this message.</p>\r\n<p>To keep your account secure, please don\'t forward this email to anyone.</p>\r\n<p> </p>\r\n<p>Thanks & Regards,</p>\r\n<p><a href=\"[site_url]\">[site_title]</a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Active', 3, NULL, '2020-02-14 13:41:16', '2020-02-14 13:41:16'),
(6, 'Profile Updated', 'Profile Updated', '<p>[logo]</p>\r\n<p> </p>\r\n<p>Dear [full_name],</p>\r\n<p>Your profile password has been updated. If is it you so ignore this email otherwise check your account. thanks</p>\r\n<p>To keep your account secure, please don\'t forward this email to anyone.</p>\r\n<p> </p>\r\n<p>Thanks & Regards,<br>[site_title]</p>\r\n<p> </p>\r\n<p> </p>', 'Active', 4, NULL, '2020-07-26 00:00:35', '2020-07-26 00:00:35'),
(7, 'Thank You', 'Thank You', '<p></p>\r\n<p>[logo]</p>\r\n<p> </p>\r\n<p>Dear [full_name],</p>\r\n<p>Thank you for your order. I truly appreciate your patronage. I will get your creation out asap.</p>\r\n<p></p>\r\n<p>Regards and Have a great day!</p>\r\n<p>Carole</p>', 'Active', 5, NULL, '2023-06-08 23:26:46', '2023-06-08 23:26:46');
