(11, 'Home', 'Home', '', 0, 0, 'Handmade, Affordable, and Beautiful Gifts - Custom Orders Are Welcome!', '<p>Handmade, Affordable, and Beautiful Gifts - Custom Orders Are Welcome!</p>', '', 'Handmade Jewelry PA | Personalized Home Decor | Cak Creation', 'handmade jewelry pa, handmade products in irwin, handmade products in irwin pa', 'Discover exquisite handmade jewelry and personalized home decor at Cak Creations. Explore unique hand-crafted pieces made with love in Irwin, PA.', 'Published', 'Default', 'Yes', 1, 'inactive', '', NULL, 92, '2020-05-03 20:59:17', '2024-01-14 00:31:47'),
(14, 'Terms & Conditions**', 'Terms Conditions**', 'terms-conditions', 0, 0, '', '<p style=\"text-align: justify;\"><span>Please contact the me if there are any issues with your purchase. Returns are only accepted within 10 days of product receipt for a full refund minus the shipping costs. Product must be shipped back to us before the refund is submitted. All my handmade items are guaranteed, and I will repair or replace the item of equal value. <strong>Custom orders are not refundable.</strong></span></p>', 'logo_pcpp1.png', 'Terms and Conditions | Cak Creations - Your Trusted Creations Partner', 'Terms and Conditions, Cak Creations Policies, Crafted Creations Guidelines, Order Process Terms, Customer Commitments, Crafted Creations Policies', 'Explore the terms and conditions of Cak Creations, your trusted source for beautifully crafted creations. Read about our policies, order processes, and customer commitments. ', 'Published', 'Container Width', 'No', 5, 'inactive', '', '', 92, '2020-05-28 16:17:31', '2023-12-05 00:40:46'),
(15, 'Contact Us', 'Contact CakCreations: Your Trusted Custom Fashion Jewelry and Home Decor Maker', 'contact-us', 0, 0, '', '<p>Thank you for your interest in CakCreations! If you have any inquiries, custom requests, or if you simply want to learn more about our handmade jewelry and unique creations, please feel free to get in touch with us. We value your ideas and are here to bring your vision to life.</p>\r\n<p>You can reach out to our skilled artisans and custom jewelry maker by filling out the form below or by contacting us directly at <a href=\"tel:412-600-3767\">412-600-3767</a> or <a href=\"mailto:carolebydesign@gmail.com\">carolebydesign@gmail.com</a>. We\'re dedicated to providing personalized service, ensuring that your experience with Cak Creations is exceptional from start to finish.</p>\r\n<p>Whether you\'re looking for a custom fashionable or statement ring, personalized necklace, or any other bespoke jewelry item, we are here to assist you every step of the way. Let us know your preferences, and we\'ll craft a piece that is as unique as you are.</p>\r\n<p>Thank you for considering CakCreations for your custom design needs. We look forward to hearing from you and creating something truly extraordinary together.</p>\r\n<p>[include file = \'contact_us.php\']</p>', 'logo_pcpp2.png', 'Contact Custom Jewelry Maker | Get in Touch with CakCreations', 'contact custom jewelry maker, custom home decor maker, unique and custom occasion designs', 'Have questions or custom requests? Contact custom jewelry maker CakCreations for personalized assistance. Your dream piece is just a message away!', 'Published', 'Default', 'Yes', 3, 'inactive', '', NULL, 92, '2020-05-29 00:21:31', '2023-12-05 00:40:05'),
(17, 'Privacy Policy', 'Privacy Policy: Your Data, Our Commitment', 'privacy-policy', 0, 0, '', '<p>At Cak Creations, we value your privacy and are committed to safeguarding your personal information. Our Privacy Policy outlines how we collect, use, and protect your data when you visit or make a purchase from our website, <a href=\"http://www.cakcreations.com/\">www.cakcreations.com</a>.</p>\r\n<p><strong>Information We Collect:</strong></p>\r\n<p>When you visit our site, we automatically collect certain information about your device, such as your web browser, IP address, time zone, and cookies. This information helps us improve your browsing experience. Additionally, when you make a purchase, we collect your name, billing address, shipping address, payment information, email address, and phone number to fulfill your orders.</p>\r\n<p><strong>How We Use Your Information:</strong></p>\r\n<p>We use your information to process orders, communicate with you, and provide personalized services. We may also use it to screen for potential risks or fraud, improve our website, and tailor our marketing strategies.</p>\r\n<p><strong>Sharing Your Information:</strong></p>\r\n<p>We share your personal information with trusted third parties, including Shopify for our online store and Google Analytics for website analytics. Rest assured, we only share what\'s necessary to enhance your experience with Cak Creations.</p>\r\n<p><strong>Your Rights:</strong></p>\r\n<p>If you have questions about your data or want to exercise your rights, such as accessing, correcting, or deleting your information, please reach out to us at <a href=\"mailto:carolebydesign@gmail.com\">carolebydesign@gmail.com</a>. European residents have specific rights regarding their personal data, and we\'re here to assist you in any way we can.</p>\r\n<p><strong>Data Retention:</strong></p>\r\n<p>We keep your order information for our records unless you request its deletion. Your trust is vital to us, and we handle your data responsibly and securely.</p>\r\n<p><strong>Changes to Our Policy:</strong></p>\r\n<p>We may update our Privacy Policy to reflect changes in our practices or for legal and operational reasons. Please review this policy periodically to stay informed about how we protect your data.</p>\r\n<p>For more information about our privacy practices or if you have any questions or concerns, please contact us at the provided email address or by mail at:</p>\r\n<p>CAKCreations<br />PCPP - Personal Creations For Practical People<br />2018 Bernice Drive, Irwin PA 15642<br />United States</p>', NULL, 'Privacy Policy | Your Data Matters at Cak Creations', 'Privacy policy, cak creations', 'Learn how your personal information is handled at Cak Creations. Read our Privacy Policy to understand how we collect, use, and protect your data.', 'Published', 'Default', 'No', 4, 'inactive', '', NULL, 92, '2020-06-19 14:01:52', '2023-10-13 22:17:57'),
(18, 'About Us', 'About CakCreations: Crafting Artistry in Custom Fashion Jewelry and Home Decor', 'about-us', 0, 0, '', '<h2 style=\"text-align: center;\"><span style=\"font-size: 18pt; color: var(--primary-color); display: inline !important;\">Welcome to CakCreations, where creativity knows no bounds. I\'m Carole, the founder of this artistic venture, and I\'m thrilled to share my passion for hand-crafted wonders with you.&nbsp;</span></h2>\r\n<p></p>\r\n<div>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><strong>Crafting Unique Jewelry Pieces:</strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\">At CakCreations, we take pride in creating custom fashion jewelry that captures the essence of your individuality. Each piece is meticulously crafted, reflecting our commitment to quality and artistry. As your dedicated local artist in Irwin, PA,&nbsp; I draw inspiration from our vibrant community, infusing it into every creation.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><strong>Laser-Engraved Home Goods:</strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\">In addition to our jewelry, we offer a range of laser-engraved home goods, including coasters, coffee tumblers, cutting boards, and more. These personalized items are designed to elevate your living spaces and make meaningful gifts for your loved ones.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><strong>Your Personalized Experience:</strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\">What sets CakCreations apart is our ability to bring your visions to life. Whether you\'re seeking a bespoke piece of jewelry or personalized home decor, we welcome custom order requests. Your satisfaction is our top priority, and we\'re dedicated to ensuring your experience with CakCreations is exceptional.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><strong>Supporting Local Artisans:</strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: var(--foreground-color); font-size: 18pt; font-weight: var(--body-font-weight); display: inline !important;\">By choosing CakCreations, you\'re not just acquiring hand-crafted treasures, you\'re supporting local artisans and the vibrant arts community in Irwin, PA. Thank you for being a part of our creative journey, and we look forward to crafting something extraordinary just for you.</span></p>\r\n</div>\r\n<div style=\"text-align: left;\"></div>\r\n<div>\r\n<div style=\"text-align: left;\"><span style=\"font-size: 18pt;\">You can also order from my Etsy shop if you prefer:</span></div>\r\n<div style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><a href=\"https://www.etsy.com/shop/PCPPCreations\">https://www.etsy.com/shop/PCPPCreations</a></span></div>\r\n</div>', NULL, 'Discover CakCreations: Local Custom Jewelry and Home Decor Maker in Irwin, PA', 'custom jewelry maker, local artist Irwin, Irwin-based artist, Westmoreland County artist, custom home decor artist', 'Meet Carole, the creative mind behind CakCreations. As your trusted local custom jewelry and home decor maker in Irwin, PA. Explore our artisanal creations.', 'Published', 'Container Width', 'Yes', 2, 'inactive', '', NULL, 92, '2020-06-23 13:14:16', '2023-12-05 17:13:38'),
