(30, 'Return Policy', 'Return Policy', 'return-policy', 0, 0, '', '<h2 style=\"text-align: justify;\"><img src=\"../../../assets/frontend/media/site-img50.jpg\" alt=\"\" style=\"float: left;\" />Return Policy</h2>\r\n<p style=\"text-align: justify;\"><span>Please contact the me if there are any issues with your purchase. Returns are only accepted within 10 days of product receipt for a full refund minus the shipping costs. Product must be shipped back to me before the refund is submitted. All my handmade items are guaranteed, and I will repair or replace the item of equal value. </span></p>\r\n<p style=\"text-align: justify;\"><span><strong>Please note: Custom orders are not refundable</strong>.</span>&nbsp;</p>\r\n<p style=\"text-align: justify;\">.</p>', NULL, 'Return Policy', '', '', 'Published', 'Container Width', 'No', 9, 'inactive', '', NULL, 17, '2020-06-23 14:50:11', '2023-07-21 21:55:53'),
(31, 'Shipping Delivery', 'Shipping Delivery', 'shipping-delivery', 0, 0, '', '<h2 style=\"text-align: justify;\"><img src=\"../../../assets/frontend/media/site-img50.jpg\" alt=\"\" style=\"float: left;\" />Shipping Delivery</h2>\r\n<p></p>\r\n<p>All of my creations are created and shipped directly from me at Personal Creations for Practical People LLC in Irwin, PA 15642.</p>\r\n<p>I use the United States Postal Service (First Class) with tracking for shipping my products directly to you in packaging that will protect your purchase.&nbsp; I offer discounted shipping costs for all orders in the United States.</p>\r\n<p>&nbsp;</p>', 'logo_pcpp.png', 'Shipping Delivery', '', '', 'Published', 'Container Width', 'No', 8, 'inactive', '', NULL, 92, '2020-06-23 14:54:29', '2023-11-27 23:51:24');
