(4344, 92, 'Handmade Christmas Puzzles Ready to Decorate - Made in the USA', 'handmade-christmas-puzzles-ready-to-decorate-made-in-the-usa', 'Handmade-Christmas-Puzzles-Ready-to-Decorate2.jpg', 3, '<p>The puzzles are made of balsawood that have been cut out on my laser. These are unfinished and ready for painting and decorating. Fun family activity for the season. As always custom orders welcome!</p>', '<p>The puzzles are made of balsawood that have been cut out on my laser. These are unfinished and ready for painting and decorating. Fun family activity for the season. As always custom orders welcome!</p>', '', NULL, '', NULL, 'PCPP-99993', 'Normal', '888883', '0', 14.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Handmade Christmas Puzzles - Festive Holiday Challenges for All', 'Handmade Christmas Puzzles, Festive Holiday Challenges, Christmas-themed Puzzles, Unique Holiday Gifts, Family Entertainment, Custom Christmas Games', 'Discover joy in solving our Handmade Christmas Puzzle. Crafted with care, this festive puzzle offer engaging challenge and delightful holiday-themed designs.', 'No', 'Yes', 999, 'Normal', 'Inactive', 1, 'CakCreations', NULL, '2023-10-13 23:13:36'),
(4345, 92, 'Handmade Christmas Scenes Fun Stud Earrings - Set of 2 - Great Stocking Stuffer', 'handmade-christmas-scenes-fun-stud-earrings-set-of-2-great-stocking-stuffer', 'Fun-Stud-Earrings.jpg', 5, '<p><span>Exciting Stocking Fillers! Enjoyable and budget-friendly! Handcrafted Gold Earrings with Stainless Steel Studs, featuring 12mm Cabochons. Receive two pairs in each set with Printed Glass Dome Cabochons.</span></p>', '<p>Great Stocking Stuffers! Fun and affordable! \\n \\nHandmade Stainless Steel Stud Gold Earring Cabochon 12mm earrings. 2 pairs included. \\n \\nPrinted Glass Dome Cabochons.</p>', '', NULL, '', NULL, 'PCPP-99995', 'Normal', '888885', '0', 12.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Handmade Christmas Scenes Fun Stud Earrings - Festive Holiday Fashion', 'Handmade Christmas Scenes Stud Earrings, Festive Holiday Fashion, Holiday Scene Jewelry, Unique Holiday Gifts, Christmas-themed Studs, Fun Holiday Earrings', 'Elevate your holiday style with our Handmade Christmas Scenes Fun Stud Earrings. These festive accessories capture the charm of the season with delightful holiday scenes.', 'Yes', 'Yes', 999, 'Normal', 'Active', 1, 'CakCreations', NULL, '2023-12-05 02:13:32'),
(4346, 92, 'Handmade Christmas Lights Earrings Great for Gift Giving on Holidays', 'handmade-christmas-lights-earrings-great-for-gift-giving-on-holidays', 'Christmas-Lights-Earrings-red.jpg', 6, '<p>Christmas light earrings were handmade with color beads and silver beads hanging from stainless steel ear wires. Fun holiday earrings.</p>', '<p>Christmas light earrings were handmade with color beads and silver beads hanging from stainless steel ear wires. Fun holiday earrings.</p>', '', NULL, '', NULL, 'PCPP-99996', 'Normal', '888886', '0', 14.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Handmade Christmas Lights Earrings - Festive Holiday Jewelry', 'Handmade Christmas Lights Earrings, Festive Holiday Jewelry, Sparkling Christmas Accessories, Unique Holiday Gifts, Holiday Party Fashion, Christmas-themed Jewelry', 'Elevate your holiday spirit with our Handmade Christmas Lights Earrings. Perfect for holiday parties and a thoughtful gift for loved ones.', 'Yes', 'Yes', 999, 'Normal', 'Active', 1, 'CakCreations', NULL, '2023-10-13 23:00:51'),
(4347, 92, 'Handmade Ugly Sweater Earrings - Great Gift for Holidays', 'handmade-ugly-sweater-earrings-great-gift-for-holidays', 'products-images.jpg', 7, '<p>Fun Ugly Christmas Sweater earrings with stainless steel ear wires.</p>', '<p>Fun Ugly Christmas Sweater earrings with stainless steel ear wires.</p>', '', NULL, '', NULL, 'PCPP-99997', 'Normal', '888887', '0', 14.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Handmade Ugly Sweater Earrings: Festive Holiday Fashion', 'Handmade Ugly Sweater Earrings, Festive Holiday Fashion, Ugly Sweater Party Accessories, Unique Holiday Jewelry, Fun Christmas Earrings, Whimsical Holiday Accessories', 'Elevate your holiday style with our Handmade Ugly Sweater Earrings. These festive accessories capture the fun and charm of ugly sweater parties.', 'Yes', 'Yes', 999, 'Normal', 'Active', 1, 'CakCreations', NULL, '2023-10-13 23:28:39'),
(4348, 92, 'Handmade Christmas Grinch Earrings - Great Gift', 'handmade-christmas-grinch-earrings-great-gift', 'grinch.jpg', 8, '<p><span>Top-Selling Earrings Alert! Check out these festive Christmas Fun Grinch earrings featuring stainless steel ear wires. They\'re double-sided, ensuring the Grinch is visible from both angles. If you love our Beetlejuice ones, these will capture your heart too!</span></p>', '<p>Christmas Fun Grinch earrings with stainless steel ear wires. Double sided so the Grinch is visible from both sides. Love these as much as the Beetlejuice ones.</p>', '', NULL, '', NULL, 'PCPP-99998', 'Normal', '888888', '0', 18.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Handmade Christmas Grinch Earrings - Holiday Accessories', 'Handmade Christmas Grinch Earrings, Festive Holiday Accessories, Whimsical Grinch Jewelry, Unique Holiday Gifts, Christmas Fashion, Grinch-themed Jewelry', 'Elevate your holiday style with our Handmade Christmas Grinch Earrings. These accessories capture the spirit of the season with a touch of whimsy.', 'Yes', 'Yes', 999, 'Featured', 'Active', 1, 'CakCreations', NULL, '2023-12-05 02:15:11'),
