(4350, 92, 'Handmade Holiday Coasters 2 - Great Gift', 'handmade-holiday-coasters-2-great-gift', 'Handmade-Holiday-Coasters-2-Great-Gift-peace.jpg', 11, '<p>These are made of unfinished wood and have been engraved with a diode laser. I have sprayed them with a clear coat to protect the design. These coasters are 4 x 4 rounds.</p>', '<p>These are made of unfinished wood and have been engraved with a diode laser. I have sprayed them with a clear coat to protect the design. These coasters are 4 x 4 rounds.</p>', '', NULL, '', NULL, 'PCPP-100001', 'Normal', '888891', '0', 20.00, '1', '', 15.00, '2023-12-04', '2023-12-11', 'Handmade Holiday Coasters: Set of 2 for Stylish Home Decor', 'Handmade Holiday Coasters, Set of 2 Coasters, Festive Home Decor, Holiday Table Accessories, Unique Christmas Coasters, Stylish Drink Coasters', 'Elevate your holiday gatherings with our Handmade Holiday Coasters Set of 2. Perfect for protecting your surfaces in style or as a delightful gift for the season.', 'No', 'Yes', 999, 'Normal', 'Active', 1, 'CakCreations', NULL, '2023-12-05 00:04:15'),
(4351, 92, 'Handmade Halloween BeetleJuice Earrings', 'handmade-halloween-beetlejuice-earrings', 'Handmade-Halloween-BeetleJuice-Earrings.jpg', 12, '<p><span>Top-Selling Earrings Alert! Check out these festive BeetleJuice earrings featuring stainless steel ear wires. They\'re double-sided, ensuring the BeetleJuice is visible from both angles. If you love our Grinch ones, these will capture your heart too!</span></p>', '<p>Handmade Halloween BeetleJuice Earrings - fun for everyone all year long!</p>', '', NULL, '', NULL, 'PCPP-100002', 'Normal', '888892', '0', 18.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Handmade Halloween BeetleJuice Earrings: Spooky and Stylish Accessories', 'Handmade Halloween BeetleJuice Earrings, Spooky Fashion Accessories, Stylish Halloween Jewelry, Unique Halloween Gifts, Supernatural Earrings, Halloween Party Fashion', 'Elevate your Halloween style with our Handmade Halloween BeetleJuice Earrings. These spooky yet stylish accessories capture the essence of the season.', 'Yes', 'Yes', 999, 'Bestseller', 'Active', 1, 'CakCreations', NULL, '2023-12-05 02:16:34'),
