(4668, 92, 'Handmade Penny Necklace Great Gift for Her Great Gift For Him Made in USA', 'handmade-penny-necklace-great-gift-for-her-great-gift-for-him-made-in-usa', '20210326_115759_(1)-PhotoRoom1.png', 274, '<div class=\"product-single__description rte\"><span>Penny for Your Thoughts necklace. Penny has been dipped in a clear protective coating so it will not tarnish or turn your skin green. 18 in antiqued copper chain with a lobster claw closure. You can request a specific year that is meaningful to you. We can also create earrings with the pennies. </span></div>', '<div class=\"product-single__description rte\"><span>Penny for Your Thoughts necklace. Penny has been dipped in a clear protective coating so it will not tarnish or turn your skin green. 18 in antiqued copper chain with a lobster claw closure. You can request a specific year that is meaningful to you. We can also create earrings with the pennies.&nbsp;</span></div>', '', NULL, '', NULL, 'PCPP-100264', 'Normal', '889154', '0', 18.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Handmade Penny Necklace | Unique Coin Jewelry for Timeless Elegance', 'Handmade Penny Necklace, Unique Coin Jewelry, Vintage Penny Pendant, Timeless Coin Accessories, Artisan Crafted Necklace, Stylish Numismatic Fashion', 'Elevate your style with our Handmade Penny Necklace. Crafted with precision and care, this unique necklace features a genuine penny, adding a touch of timeless elegance to your ensemble.', 'Yes', 'Yes', 999, 'Bestseller', 'Active', 1, 'CakCreations', NULL, '2023-12-02 17:55:26'),
