(4670, 92, 'Stronger Than The Storm - Affirmation Keychain', 'stronger-than-the-storm-affirmation-keychain', 'PhotoRoom-20230505_160541.png', 464, '<p><span>This meaningful and beautiful keychain is made from stainless steel and engraved with a powerful affirmation message to remind you of your inner strength. Handmade and durable, the 33 mm disc is perfect for keeping your keys safe and organized.</span></p>', '', '', NULL, '', NULL, 'Pcpp-stts', 'New', 'keychains', '0', 18.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Stronger Than The Storm Affirmation Keychain | Empowering Daily Reminder', 'Stronger Than The Storm Keychain, Empowering Affirmation Keychain, Resilience Reminder, Positive Daily Affirmation, Inspirational Keychain, Motivational Accessories', 'Carry resilience with you wherever you go with our Stronger Than The Storm Affirmation Keychain. Crafted with strength and care, this keychain serves as an empowering daily reminder. ', 'Yes', 'Yes', 999, 'Trending', 'Active', 1, 'cakcreations', NULL, '2023-12-02 19:25:48'),
(4671, 92, 'Dont Drink and Drive - Affirmation Keychain - Great Gift', 'dont-drink-and-drive-affirmation-keychain-great-gift', 'PhotoRoom-20230505_160350.png', 465, '<p><span>Our Don\'t Drink and Drive Affirmation Keychain is crafted with stainless steel for superior durability and quality. Its 33mm disc is engraved with a positive reminder to stay safe on the road. A subtle, yet effective way to keep your commitment to yourself and your loved ones.</span></p>', '', '', NULL, '', NULL, 'Pcpp-dddaf', 'New', 'keychains', '0', 18.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Dont Drink And Drive Affirmation Keychain Great Gift', 'Don\'t Drink and Drive Keychain, Responsibility Gift, Affirmation Keyring, Thoughtful Present, Safety Reminder, Practical Gift Idea', 'Spread awareness and safety with our \'Don\'t Drink and Drive\' Affirmation Keychain. Explore our collection of affirmation keychains.', 'Yes', 'Yes', 999, 'Trending', 'Active', 1, 'cakcreations', NULL, '2023-12-02 19:26:03'),
(4672, 92, 'Killin\' It Every Day- Affirmation Keychain', 'killin-it-every-day-affirmation-keychain', 'PhotoRoom-20230505_160248.png', 466, '<p><span>This Killin\' It Every Day- Affirmation Keychain is the perfect accessory to boost your daily confidence. Crafted with premium stainless steel, the 33 mm disc is engraved with an inspiring message to keep you motivated. Show your strength, determination, and positivity with this handmade keychain.</span></p>', '', '', NULL, '', NULL, 'Pcpp-kaff', 'New', 'keychains', '0', 18.00, '1', '', 0.00, '0000-00-00', '0000-00-00', 'Killin\' It Every Day Affirmation Keychain | Empowering Daily Reminder', 'Killin\' It Every Day Keychain, Empowering Affirmation Accessories, Daily Confidence Reminder, Motivational Keychain, Stylish Empowerment, Self-Confidence Boost', 'Carry confidence with our \'Killin\' It Every Day\' Affirmation Keychain. Crafted with quality materials, this empowering keychain serves as a daily reminder of your strength and resilience.', 'Yes', 'Yes', 999, 'Trending', 'Active', 1, 'cakcreations', NULL, '2023-12-02 19:26:18'),
(4675, 92, 'LED Night Lights - Various Engraved Acrylic Designs - Great Gift for Anyone - Beautiful Room Decor', 'led-night-lights-various-engraved-acrylic-designs-great-gift-for-anyone-beautiful-room-decor', 'fairy_in_the_moon.jpg', 1, '<p>Experience the enchanting 3D Night LED Light Lamp Base, featuring a spectrum of 16 vibrant colors, controlled effortlessly via a remote. Choose between a sleek black or pristine white base, offering touch-activated on/off functionality or convenient remote control. The package includes a USB cable for power, or for greater mobility, utilize 3 AA batteries (not included). Discover the option for custom engravings on the acrylic surface, adding a personalized touch to your lighting experience.</p>\r\n<p>Any graphic can be used in the design, just reach out to me for what you\'re looking for.</p>', '', NULL, NULL, NULL, NULL, 'ledlights', 'New', 'Home Decor', '0', 30.00, '1', '', 22.50, '2023-11-27', '2023-11-30', 'LED Night Lights Various Engraved Acrylic Designs Great Gift For Anyone Beautiful Room Decor', 'led, night light, decor, battery operated, USB powered, ', 'handmade scribed night lights', 'Yes', 'Yes', 5, 'Normal', 'Active', 1, 'cakcreations', '2023-11-27 23:29:57', '2023-11-28 00:54:29');
