INSERT INTO `testimonials` (`id`, `image`, `message`, `name`, `designation`, `company`, `ordering`, `status`, `created`, `modified`) VALUES
(5, '', '<p>Carole works hard and long to continue creating handmade items for her customers. She has a full-time job on top of that. This is her dream and will go at it 100% when she retires in a couple years. You won\'t be disappointed!</p>', 'Brian K', 'Customer', '', 0, 'Active', '2023-07-21 22:25:36', '2023-07-21 22:25:36'),
(6, '', '<p class=\"wt-text-caption-title\">Smooth shipping</p>\r\n<p class=\"wt-text-caption\">Has a history of shipping on time with tracking.</p>', 'Lynn T', 'Customer', '', 0, 'Active', '2023-07-21 23:23:07', '2023-07-21 23:23:07'),
(7, '', '<p class=\"wt-text-caption-title\">Loved the earrings and wear them often. SHhipping was fast and painless and excellent customer service. Will definitely be ordering from her again!</p>\r\n<p class=\"wt-text-caption\"></p>', 'Amy S', 'Customer', '', 0, 'Active', '2023-07-21 22:16:54', '2023-07-21 22:16:54'),
(8, '', '<p>Excellent customer service and fast shipping. She is easy to deal with and answered all of my questions before I ordered. </p>', 'Jocelyn F', 'Customer', '', 0, 'Active', '2023-07-21 22:49:09', '2023-07-21 22:49:09'),
(9, '', '<p>Lovely products and great customer service. You won\'t be sorry!</p>', 'Jackie A', 'Customer', '', 0, 'Active', '2023-07-21 22:24:37', '2023-07-21 22:24:37');
